import home5 from "../../assets/home5.png";
import classes from "./AddressMap.module.css";

const AddressMap = () => {
  return (
    <div className={classes.homemap}>
      <div className={classes.home_}>
        <img src={home5} />
        <p></p>
      </div>
      {/* <div className={classes.map_}>
        <img src={home5} />
        <p></p>
      </div> */}
    </div>
  );
};

export default AddressMap;
